import React, { Fragment } from "react";

const Header = () => {
  return (
    <Fragment>
      <header>
        <h1>Scooter Mail Army</h1>
        <select>
          <option value="0">Usuario 1</option>
          <option value="1">Usuario 2</option>
          <option value="2">Usuario 3</option>
          <option value="3">Usuario 4</option>
          <option value="4">Usuario 5</option>
          <option value="5">Usuario 6</option>
          <option value="6">Usuario 7</option>
          <option value="7">Usuario 8</option>
          <option value="8">Usuario 9</option>
          <option value="9">Usuario 10</option>
        </select>
      </header>
    </Fragment>
  );
};

export default Header;
